     var underOpen = function(items){
       
            var l = items.length;
            

            function next(i){
                var href = items[i];
                if(href){
                    iframeWindow({url:href,callback:function(){
                        if(i<l){
                            next(i+1);
                        }
                    }});
                }
                
            }

            next(0);
         
    };

