         swiper = swiper.length==0?ele:swiper;

         if(swiper.length==0){
            doc.html(`<div class="owl-carousel owl-theme"></div>`);
            swiper = doc.find(".owl-carousel");
         }
         var tab = doc.find(".toolbar-inner").hide();

         //
