function runmain_(u,f){
    var forcelogin = 1;
    if(u&&u.token){
        $('[name="auth-token"]').attr("content",u.token);
    }


    var pi = pointer;
    
    if(forcelogin){
      pi = u?pointer:"/user/login/";
    } 
    if(f){
       pi = f(u,pi);
    }

    if(typeof pi=='function'){
        pi(mainView.router);
    }else{
        mainView.router.navigate(pi||pointer, {});
    } 
}
